import React from "react";
import { Prompt } from "react-router-dom";
const ManageCoursePage = props => {
  return (
    <>
      <h2>Manage Course</h2>
      <Prompt when={true} message="Are you sure to Leave ?" />
      {props.match.params.slug}
    </>
  );
};

export default ManageCoursePage;
